export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},aK7NVV2afo:{data:{id:1413,attributes:{imdbId:"tt0053902",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYmU3MjgzNmMtMDU3YS00OGM1LTkyOWUtZmVlOGQ1MTkzYjBkXkEyXkFqcGdeQXVyMTQ3Njg3MQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.9\u002F10"}],item_lang:{data:{id:2076,attributes:{title:"Heller in Pink Tights",plot:"Nineteenth century Wyoming: the wild West. Mild-mannered Tom Healy has a two-wagon theater troupe hounded by creditors because Angela, his leading lady and the object of his affection, constantly buys clothes. In Cheyenne, they meet with applause, so they hope to stay awhile: the theater owner likes Angela, and she keeps him on a string. She's also the object of the attentions of Mabry, a gunslinger who's owed money by the richest man in Bonanza. Complications arise and the troupe heads for Bonanza, through hostile Indian territory. Is the troupe doomed to a peripatetic life, is Mabry in danger, and does Tom stand a chance with Angela, a hellion in pink tights?",slug:"heller-in-pink-tights"}}},books:{data:[{id:7543,attributes:{title:"Heller with a Gun",description:"Tom Healy was in trouble. His theatrical troupe needed to get to Alder Gulch, Montana, and the weather was turning. Andy Barker promised Tom he could get them there safely, but Tom was reluctant to trust him: he had the lives of three actresses to consider, and his personal feelings for Janice further heightened his concern. Then King Mabry showed up. Although Tom didn’t like the way he looked at Janice, he could see that Mabry made Barker uneasy. So Tom invited Mabry to join them. Tom was right to be worried, because Barker had a plan. He knew that the wagons carried something more than actors and scenery. He and his men were going to steal it any way they could. And that included murder.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bTT64h1-XE8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2004-02-03",publisher:"Domain",subtitle:e}},{id:7544,attributes:{title:"Kilkenny (Louis L'Amour's Lost Treasures)",description:"As part of the Louis L’Amour’s Lost Treasures series, this edition contains exclusive bonus materials! Kilkenny wasn’t looking for trouble when he entered the Clifton House stage station, but trouble found him when a reckless youngster named Tetlow challenged him, drew his gun, and paid for it with his life. Looking to escape a reputation that he never wanted, Kilkenny settles in the lonely mountain country of Utah, planning to ranch a high, lush valley. But the past is on his trail. Jared Tetlow is a powerful rancher determined to run his vast herd on the limited grasslands there—whether he has to buy out the local ranchers, run them out, or kill them. He’ll cut down anyone who stands in his way, especially a man he already despises: the gunman named Kilkenny—the man who killed his son. Louis L’Amour’s Lost Treasures is a project created to release some of the author’s more unconventional manuscripts from the family archives. In Louis L’Amour’s Lost Treasures: Volumes 1, Beau L’Amour takes the reader on a guided tour through many of the finished and unfinished short stories, novels, and treatments that his father was never able to publish during his lifetime. L’Amour’s never-before-seen first novel, No Traveller Returns, faithfully completed for this program, is a voyage into danger and violence on the high seas. These exciting publications will be followed by Louis L’Amour’s Lost Treasures: Volume 2. Additionally, many beloved classics will be rereleased with an exclusive Lost Treasures postscript featuring previously unpublished material, including outlines, plot notes, and alternate drafts. These postscripts tell the story behind the stories that millions of readers have come to know and cherish.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LhRpDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2018-08-28",publisher:d,subtitle:e}},{id:7545,attributes:{title:"Bowdrie (Louis L'Amour's Lost Treasures)",description:"As part of the Louis L’Amour’s Lost Treasures series, this edition contains exclusive bonus materials! It was a name that caused the most hardened gunmen to break out in a cold sweat. Chick Bowdrie. He could have ridden the outlaw trail, but the Texas Rangers recruited him because they didn't want to have to fight against him. Pursuing the most wanted men in the Southwest he knew all too well the dusty trails, the bitter cattle feuds, the desperate killers and the quiet, weather-beaten, wind-blasted towns that could explode into actions with the wrong word. He had sworn to carry out the law, but there were times when he had to apply justice with his fists and his guns. They called in the Rangers to handle the tough ones and there was never a Ranger tougher or smarter than Bowdrie. Louis L’Amour’s Lost Treasures is a project created to release some of the author’s more unconventional manuscripts from the family archives. In Louis L’Amour’s Lost Treasures: Volume 1 and Volume 2, Beau L’Amour takes the reader on a guided tour through many of the finished and unfinished short stories, novels, and treatments that his father was never able to publish during his lifetime. L’Amour’s never-before-seen first novel, No Traveller Returns, faithfully completed for this program, is a voyage into danger and violence on the high seas. Additionally, many beloved classics will be rereleased with an exclusive Lost Treasures postscript featuring previously unpublished material, including outlines, plot notes, and alternate drafts. These postscripts tell the story behind the stories that millions of readers have come to know and cherish.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aIBVDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2018-05-01",publisher:d,subtitle:h}},{id:7546,attributes:{title:"Fair Blows the Wind (Louis L'Amour's Lost Treasures)",description:"As part of the Louis L’Amour’s Lost Treasures series, this edition contains exclusive bonus materials! His father killed by the British and his home burned, young Tatton Chantry left Ireland to make his fortune and regain the land that was rightfully his. Schooled along the way in the use of arms, Chantry arrives in London a wiser and far more dangerous man. He invests in trading ventures, but on a voyage to the New World his party is attacked by Indians and he is marooned in the untamed wilderness of the Carolina coast. It is in this darkest time, when everything seems lost, that Chantry encounters a remarkable opportunity. . . . Suddenly all his dreams are within reach: extraordinary wealth, his family land, and the heart of a Peruvian beauty. But first he must survive Indians, pirates, and a rogue swordsman who has vowed to see him dead. Louis L’Amour’s Lost Treasures is a project created to release some of the author’s more unconventional manuscripts from the family archives. In Louis L’Amour’s Lost Treasures: Volumes 1, Beau L’Amour takes the reader on a guided tour through many of the finished and unfinished short stories, novels, and treatments that his father was never able to publish during his lifetime. L’Amour’s never-before-seen first novel, No Traveller Returns, faithfully completed for this program, is a voyage into danger and violence on the high seas. These exciting publications will be followed by Louis L’Amour’s Lost Treasures: Volume 2. Additionally, many beloved classics will be rereleased with an exclusive Lost Treasures postscript featuring previously unpublished material, including outlines, plot notes, and alternate drafts. These postscripts tell the story behind the stories that millions of readers have come to know and cherish.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4NhfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2018-07-03",publisher:d,subtitle:e}},{id:7547,attributes:{title:"Off the Mangrove Coast (Louis L'Amour's Lost Treasures)",description:"As part of the Louis L’Amour’s Lost Treasures series, this edition contains exclusive bonus materials! From the jungles of Borneo to the hidden canyons of the American West, from small-town fight clubs to a Parisian café at the end of World War II, here are tales of betrayal and revenge, courage and cowardice, glory and greed, as only Louis L’Amour can tell them. Here is L’Amour at his very best: A charismatic boxer itches to fight all comers—but his only shot at the championship is in beating the man who ruined his father. . . . A beautiful movie star finds a dead man in her apartment and begs her ex-lover, a tough private eye, to clear her name. . . . A reluctant hero guides a diamond-hunting couple up a river ruled by headhunters and pirates in pursuit of a legendary stone and the mysterious warlord who guards it. . . . A young renegade sails the South China Sea with a trio of dangerous men in search of treasure, but when it’s time to divide the prize, can he trust any of them? Combining electrifying action scenes, vivid historical detail, and characters who seem to leap off the page, these spectacular stories honor the legend of Louis L’Amour. Louis L’Amour’s Lost Treasures is a project created to release some of the author’s more unconventional manuscripts from the family archives. In Louis L’Amour’s Lost Treasures: Volumes 1, Beau L’Amour takes the reader on a guided tour through many of the finished and unfinished short stories, novels, and treatments that his father was never able to publish during his lifetime. L’Amour’s never-before-seen first novel, No Traveller Returns, faithfully completed for this program, is a voyage into danger and violence on the high seas. These exciting publications will be followed by Louis L’Amour’s Lost Treasures: Volume 2. Additionally, many beloved classics will be rereleased with an exclusive Lost Treasures postscript featuring previously unpublished material, including outlines, plot notes, and alternate drafts. These postscripts tell the story behind the stories that millions of readers have come to know and cherish.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bUhvDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2018-10-02",publisher:d,subtitle:h}}]}}},meta:{}}},prerenderedAt:1681377335323}}("Louis L'Amour","movie",null,"Bantam","A Novel","series",1,"Stories"))